import Apps from './App.scss';


function App() {
  return (
    <div className="App">
      <header className="App-header">
      <a href="tel:+5491161521203">Aqu√≠ el texto que quieras</a>

      <a href={Apps} download="App.scss">
Descargar Archivo
</a>
        <p>
          Edit <code>src/App.js</code> and save to reload.
